sys_variable_value.value:
(function execute(inputs, outputs) {
  var funcName = "nsw2 calculate service quote: ";
  gs.info(funcName + "called from flow");
  var rate_calc_parts = "";
  var calculatedRate = 0.0;
  var providerList = [];
  var cpeCost = parseFloat(inputs.cpe_cost);
  var coreCost = parseFloat(inputs.core_cost);
  var callMsg = "called from flow with HA = " + inputs.high_availability + ", providers: " + inputs.telco_prov1 + ", " + inputs.telco_prov2;
  gs.info(funcName + callMsg);
  if (inputs.high_availability) {
    //calculatedRate = (cpeCost + coreCost) * 2;
    // Keith explained core should count only once
    // 02/21/22 modify calculaton for HA
    calculatedRate = (cpeCost * 2) + coreCost;
    providerList = [inputs.telco_prov1, inputs.telco_prov2];
    //rate_calc_parts = "HA cpe: " + inputs.cpe_cost + " core: " + inputs.core_cost + " * 2 ";
    rate_calc_parts = "HA core: " + inputs.core_cost + " cpe: " + inputs.cpe_cost + " * 2 ";

    // add in provider rates
    while (inputs.provider_rate_rcds.next()) {
      var provRate = parseFloat(inputs.provider_rate_rcds.cost);
      if (inputs.provider_rate_rcds.provider == providerList[0] || inputs.provider_rate_rcds.provider == providerList[1]) {
        rate_calc_parts = rate_calc_parts + "prov: " + inputs.provider_rate_rcds.provider + " " + inputs.provider_rate_rcds.cost + " ";
        calculatedRate = calculatedRate + provRate;
      }
    }
  } else {
    calculatedRate = cpeCost + coreCost;
    providerList = [inputs.telco_prov1];
    rate_calc_parts = "cpe: " + inputs.cpe_cost + " core: " + inputs.core_cost + " ";

    // add in provider rates
    while (inputs.provider_rate_rcds.next()) {
      var provRate = parseFloat(inputs.provider_rate_rcds.cost);
      if (inputs.provider_rate_rcds.provider == providerList[0]) {
        rate_calc_parts = rate_calc_parts + "prov: " + inputs.provider_rate_rcds.provider + " " + inputs.provider_rate_rcds.cost + " ";
        calculatedRate = calculatedRate + provRate;
      }
    }
  }

  outputs.return_cost = calculatedRate;
  outputs.rate_calc_parts = rate_calc_parts;
  gs.info(funcName + "rate calc parts = " + rate_calc_parts);

})(inputs, outputs);

